import * as React from 'react';
import Button from '@mui/material/Button';



class PolicySelect extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            requiredItem: 0,
            data: [
                {"value": 1,"label": "Key Management"},
                {"value": 2,"label": "Role Management"},
                {"value": 3,"label": "Resource Management"}
            ]
        }
        this.handleChange = this.handleChange.bind(this);
    }
    handleChange(e) {
        console.log(e.target.value);
        this.setState({ requiredItem: e.target.value });
    }
    handleCancel () {

    }
    handleSave () {

    }
    render () {
        return (
            <div margin="40px">
            <h1>Policy Assets</h1>
            <p align = "right">
                <button>Create New Policy</button>
            </p>
            <p margin="20px">Select Policy</p>
            <select
            value={this.state.requiredItem}
            onChange={this.handleChange}
            >
            {this.state.data.map((option) => (
              <option key={option.value} value={option.value}>{option.label}</option>
            ))}
          </select>
            <p align="right">
                <button> Cancel </button>
                <button> Save </button>
            </p>
            </div>
        );
    }
}
export default PolicySelect;
